import React from 'react'
import "./menu.scss"

export default class Menu extends React.Component{

    constructor(props) {
      super(props)
      this.state ={
        productsOpen: false 
      }
    }

    render() {
      return (
        <div id="sidenav" className={ this.props.active ? "open" : ""}>
        <a href="#">About</a>
        <a href="#">Services</a>
        <p
        className = {this.state.productsOpen ? "open" : ""} 
        onClick={() => {
          this.setState({productsOpen: !this.state.productsOpen})
        }}>Products
        <div>

        </div>
        </p>
        <a href="#">Contact</a>
      </div>
    )
  }
}
